[[package]]
name = "absl-py"
version = "0.10.0"
description = "Abseil Python Common Libraries, see https://github.com/abseil/abseil-py."
category = "main"
optional = false
python-versions = "*"

[package.dependencies]
six = "*"

[[package]]
name = "alabaster"
version = "0.7.12"
